import React from 'react';
import Button from './Button';

const Quadrant = ({ title, options, handleOnClick }) => {
  return (
    <div className="quadrant">
      <h2>{title}</h2>
      {options.map((option, index) => (
        <Button key={index} name={option} handleOnClick={handleOnClick} />
      ))}
    </div>
  );
};

export default Quadrant;
